import React, { useEffect, useState } from "react";
import arr from "./all/1.mp4";
import "./App.css";
import ReactPlayer from "react-player";
const App = () => {
  const [online, setOnline] = useState();
  useEffect(() => {
    if (navigator.onLine) {
      setOnline(true);
    } else setOnline(false);
  });
  return (
    <>
      <h1>Status</h1>
      <h2>{online ? "ONLINE" : "OFFLINE"}</h2>
    </>
  );
};

export default App;
